import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { RingLoader } from 'react-spinners';

function App() {
  const [insertKey, setInsertKey] = useState('');
  const [insertValue, setInsertValue] = useState('');
  const [deleteKey, setDeleteKey] = useState('');
  const [searchKey, setSearchKey] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [notification, setNotification] = useState('');
  const [loading, setLoading] = useState(false);
  const [notificationType, setNotificationType] = useState('success');
  const [selectedHashing, setSelectedHashing] = useState('extendible');
  const [hashTableState, setHashTableState] = useState(null);

  const handleInsert = async (e) => {
    e.preventDefault();
    if (!insertKey || !insertValue) {
      setNotification('Key and Value must be provided for insertion.');
      setNotificationType('error');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`http://127.0.0.1:5000/${selectedHashing}/insert`, {
        key: parseInt(insertKey),
        value: insertValue,
      });
      setNotification(response.data.message);
      setNotificationType('success');
      setHashTableState(response.data.state);
      setInsertKey('');
      setInsertValue('');
    } catch (error) {
      setNotification('Error inserting data: ' + error.response.data.error);
      setNotificationType('error');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (e) => {
    e.preventDefault();
    if (!deleteKey) {
      setNotification('Key must be provided for deletion.');
      setNotificationType('error');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.delete(`http://127.0.0.1:5000/${selectedHashing}/delete`, {
        data: { key: parseInt(deleteKey) },
      });
      setNotification(response.data.message);
      setNotificationType('success');
      setHashTableState(response.data.state);
      setDeleteKey('');
    } catch (error) {
      setNotification('Error deleting data: ' + error.response.data.error);
      setNotificationType('error');
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!searchKey) {
      setNotification('Key must be provided for search.');
      setNotificationType('error');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.get(`http://127.0.0.1:5000/${selectedHashing}/search?key=${searchKey}`);
      setSearchResult(response.data.message);
      setNotification(`Found key ${searchKey}: ${response.data.message}`);
      setNotificationType('success');
      setHashTableState(response.data.state);
      setSearchKey('');
    } catch (error) {
      setNotification('Error searching data: ' + error.response.data.error);
      setNotificationType('error');
    } finally {
      setLoading(false);
    }
  };

  const handleReset = () => {
    setInsertKey('');
    setInsertValue('');
    setDeleteKey('');
    setSearchKey('');
    setSearchResult(null);
    setNotification('');
  };

  const renderHashTableState = () => {
    if (!hashTableState) return null;

    return (
      <div className="hash-table-state">
        <h2>Hash Table State</h2>
        {Object.entries(hashTableState.buckets).map(([index, bucket]) => (
          <div key={index}>
            <strong>Bucket {index}:</strong> {JSON.stringify(bucket)}
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="App">
      <h1>Hash Table Visualization</h1>
      <div>
        <label>Select Hashing Method:</label>
        <select value={selectedHashing} onChange={(e) => setSelectedHashing(e.target.value)}>
          <option value="linear">Linear Hashing</option>
          <option value="extendible">Extendible Hashing</option>
        </select>
      </div>
      <form onSubmit={handleInsert}>
        <h2>Insert</h2>
        <input type="text" placeholder="Key" value={insertKey} onChange={(e) => setInsertKey(e.target.value)} />
        <input type="text" placeholder="Value" value={insertValue} onChange={(e) => setInsertValue(e.target.value)} />
        <button type="submit">Insert</button>
      </form>
      <form onSubmit={handleDelete}>
        <h2>Delete</h2>
        <input type="text" placeholder="Key" value={deleteKey} onChange={(e) => setDeleteKey(e.target.value)} />
        <button type="submit">Delete</button>
      </form>
      <form onSubmit={handleSearch}>
        <h2>Search</h2>
        <input type="text" placeholder="Key" value={searchKey} onChange={(e) => setSearchKey(e.target.value)} />
        <button type="submit">Search</button>
      </form>
      {loading ? (
        <RingLoader color="#123abc" loading={loading} />
      ) : (
        <div className={`notification ${notificationType}`}>
          {notification}
        </div>
      )}
      {renderHashTableState()}
    </div>
  );
}

export default App;
